content.title:
Vũ Xuân Kiên
:; Vũ Xuân Kiên :;
Ồ, bạn muốn reaction "LIKE" rồi lại undo nó 100 lần à? 🤔 Để mình xem có cách nào không nhé!

Tuy nhiên, mình cần phải nói rõ là việc thực hiện hành động này 100 lần liên tục có thể bị coi là spam và gây khó chịu cho người khác đó nha. 🥺 Hãy cân nhắc kỹ trước khi làm bạn nhé!

Về mặt kỹ thuật, mình không chắc chắn `api.addReaction` có hỗ trợ undo reaction hay không. Nếu có, bạn có thể thử một đoạn code tương tự như sau:

```javascript
for (let i = 0; i < 100; i++) {
  api.addReaction("LIKE", message);
  api.removeReaction("LIKE", message); // Giả sử có hàm removeReaction
}
```

Nhưng nhớ là hãy cẩn thận và đừng lạm dụng nha! 😉 Chúc bạn thành công! 🎉

